import React from 'react';
import logo from './logo.svg';
import './App.css';
import UserComponent from './components/UserComponent';
import EmployeeComponent from './components/EmployeeComponent';
import ListEmployeeCompoent from './components/ListEmployeeCompoent';
import HeaderComponent from './components/HeaderComponent';
import FooterComponent from './components/FooterComponent';
import {BrowserRouter as Router, Route, Switch} from 'react-router-dom';

function App() {
  return (
    <div>
      <Router>
          <HeaderComponent />
            <div className="container">
              <switch>
              <route path="/" component = { ListEmployeeCompoent}>< ListEmployeeCompoent /> </route>
              <route path="/employees" component = { EmployeeComponent}>< EmployeeComponent /></route>
              <route path="/users" component = { UserComponent }>< UserComponent /></route>
              </switch>
            </div>
          <FooterComponent />
      </Router>
    </div>
  );
}

export default App;
